import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { BASE_URL } from './constants';

const AuthPage = () => {
  const [isLogin, setIsLogin] = useState(true); // Toggle between login and register
  const [username, setUsername] = useState(""); // Username for login/register
  const [password, setPassword] = useState(""); // Password for login/register
  const [error, setError] = useState(""); // Error message state
  const [success, setSuccess] = useState(""); // Success message state
  const navigate = useNavigate();

  useEffect(() => {
    const auth = localStorage.getItem("user");
    if (auth) {
      navigate("/");
    }
  }, [navigate]);

  // Handle Login function
  const handleLogin = async () => {
    console.log(username, password);
    try {
      let result = await fetch(`${BASE_URL}/login`, {
        method: "post",
        body: JSON.stringify({ username, password }),
        headers: {
          "Content-Type": "application/json",
        },
      });

      if (result.ok) {
        result = await result.json();
        console.log(result);
        localStorage.setItem("user", JSON.stringify(result));
        navigate("/");
      } else {
        setError("Invalid Username or Password");
        setSuccess(""); // Clear success message if there's an error
      }
    } catch (error) {
      setError("Error logging in. Please try again.");
      setSuccess(""); // Clear success message if there's an error
    }
  };

  // Handle Register function
  const handleRegister = async () => {
    console.log(username, password);
    try {
      let result = await fetch(`${BASE_URL}/register`, {
        method: "post",
        body: JSON.stringify({ username, password }),
        headers: {
          "Content-Type": "application/json",
        },
      });

      result = await result.json();

      if (result.error) {
        setError(result.error); // Display error if the user already exists
        setSuccess(""); // Clear success message if there's an error
      } else {
        console.log(result);
        localStorage.setItem("adminuser", JSON.stringify(result));
        setSuccess("User registered successfully. Please login."); // Set success message
        setError(""); // Clear any previous error
        setUsername(""); // Reset username
        setPassword(""); // Reset password
        setIsLogin(true); // Switch to the login form
      }
    } catch (error) {
      setError("Registration failed. Please try again.");
      setSuccess(""); // Clear success message if there's an error
    }
  };

  return (
    <div className="flex justify-center items-center h-screen bg-gray-100">
      <div className="w-[400px] p-8 bg-white rounded-lg shadow-lg">
        {/* Conditionally render Login or Register form */}
        {isLogin ? (
          <>
            {/* Login Form */}
            <h2 className="text-2xl font-semibold text-center mb-4">Login</h2>
            {success && <p className="text-green-500 text-sm mb-2">{success}</p>} {/* Success message */}
            <input
              type="text"
              placeholder="Enter Username"
              className="w-full p-2 mb-4 border rounded"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
            <input
              type="password"
              placeholder="Enter Password"
              className="w-full p-2 mb-4 border rounded"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            {error && <p className="text-red-500 text-sm mb-2">{error}</p>}
            <button
              className="w-full hover:bg-blue-400 bg-blue-500 text-white py-2 rounded"
              onClick={handleLogin}
            >
              Login
            </button>
            <p className="text-center mt-4">
              Don't have an account?{" "}
              <button
                className="text-blue-500 underline"
                onClick={() => {
                  setIsLogin(false);
                  setError(""); // Clear errors when switching forms
                  setSuccess(""); // Clear success message when switching forms
                }}
              >
                Register here
              </button>
            </p>
          </>
        ) : (
          <>
            {/* Register Form */}
            <h2 className="text-2xl font-semibold text-center mb-4">Register</h2>
            <input
              type="text"
              placeholder="Enter Username"
              className="w-full p-2 mb-4 border rounded"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
            <input
              type="password"
              placeholder="Enter Password"
              className="w-full p-2 mb-4 border rounded"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            {error && <p className="text-red-500 text-sm mb-2">{error}</p>}
            <button
              className="w-full hover:bg-blue-400 bg-blue-500 text-white py-2 rounded"
              onClick={handleRegister}
            >
              Register
            </button>
            <p className="text-center mt-4">
              Already have an account?{" "}
              <button
                className="text-blue-500 underline"
                onClick={() => {
                  setIsLogin(true);
                  setError(""); // Clear errors when switching forms
                }}
              >
                Login here
              </button>
            </p>
          </>
        )}
      </div>
    </div>
  );
};

export default AuthPage;
